Promotional info from Comic Vine - &quot;From the point of view of the Bugle writers and Jessica Jones, this story tells what happens at the Bugle when J. Jonah Jameson realizes that his point of view on the super heroes is dragging his paper down. No one reads anymore, any source of news can be found else where. So Jameson decides to do something that will bring the readers back, The Pulse. The Pulse is suppose to be a column that tells us what is happening in the lives of super heroes. Ben Urich working with former costumed super hero Jessica Jones to get all the inside stories, including the exclusive on Jessica's pregnancy with super hero for hire Luke Cage.&quot;

